function reenvioActiveX() {
	try {
	    if (document.MyActiveEnrolador.SetParameters(peticionBanorte)) {
//		if(true){
	       setTimeout(validarClicInicio, 1000);
	    }
	} catch (Err) {
		alert(Err.description);
	}
};

function obtenerActiveX() {
		$.ajax({
			method      : "GET",
			url         : urlObtenerRespuesta,
			contentType : "application/json",
			data		: {"peticion" : peticionBanorte}
		})
		.success(function(result) {
			if(result.flujo == 1) {
				if ($("#idBiometrico").length > 0 ) {
					$("#idBiometrico").val(result.mensaje);
				}
				$form.attr("action", actionWs);
				$form.submit();
			} else if(result.flujo == 2) {
				$("#btnErrorM").attr('href', _PAG);
				document.getElementById('tituloError').innerHTML = result.titulo;
				document.getElementById('mensajeErrorModal').innerHTML = result.mensaje;
				window.location.href = "#errorModal";
			} else if(result.flujo == 4) {
				setTimeout(reenvioActiveX, 1000);
				$("#botonesInfoModal").css("display", "none");
				$("#btnInfoM").css('display', "block");
				$("#btnInfoM").attr('href', "#");
				document.getElementById('tituloInfo').innerHTML = result.titulo;
				document.getElementById('mensajeInfo').innerHTML = result.mensaje;
				window.location.href = "#infoModal";
			} else {
				setTimeout(obtenerActiveX, 3000);
			}
		});
};

function valoresBanorte() {
	$.ajax({
		method      : "GET",
		url         : urlDato,
		contentType : "application/json",
		data		: { "tipo"		: tipo ,
						"proceso"	: proceso }
	})
	.success(function(result) {
		if(result.flujo == 1) {
			console.log(result.mensaje);
			openActiveX(result.mensaje);
		} else {
			document.getElementById('tituloError').innerHTML = result.titulo;
			document.getElementById('mensajeErrorModal').innerHTML = result.mensaje;
			window.location.href = "#errorModal";
		}
	});
};